		if (rateInputObj.baseRate.total) {
			totalAmt = rateInputObj.baseRate.total;
		}
		if (rateInputObj.accessorials) {
			for (i = 0; i < rateInputObj.accessorials.length; i++) {
				if (rateInputObj.accessorials[i]
						&& rateInputObj.accessorials[i].total
						&& (baseRateBasis || rateInputObj.accessorials[i].supportedBasis)) {
					totalAmt = totalAmt + rateInputObj.accessorials[i].total;
				}
			}
		}
		if (rateInputObj.stopBands && rateInputObj.stopOffTotal) {
			totalAmt = totalAmt + rateInputObj.stopOffTotal;
		}
		rateInputObj.total = parseFloat(totalAmt);
		return rateInputObj;
	};

